$(document).ready(()=>{var e=localStorage.getItem("id");$.ajax({url:"http://localhost:4000/user/profile/"+e,method:"GET",crossDomain:!0,xhrFields:{withCredentials:!1},success:e=>{var l;e&&(l=`${e[0].fname} ${e[0].mname} ${e[0].lname}`,$("#profile-name").html(l),$("#profile-email").html(e[0].email))},error:e=>{console.log(e)}})});